import { makeStyles } from "@material-ui/core/styles";
export default makeStyles((theme) => ({
  automationLink:{
    textDecoration:'none',
    fontFamily:'Raleway',
     color:'#191919',
     fontSize:15, 
     padding: 30,
     borderLeftWidth:5,
     borderRightWidth:5,
     borderTopWidth:5,
     borderBottomWidth:5

  },
  headContainer:{
    display:'flex',
    flex:1

  },
  leftContainer:{
    flex:0.5
  },
  leftText:{
    fontSize:70,
    fontFamily: 'Raleway'

  },
  rightContainer:{
    flex:0.5

  },
  listContainer:{
    marginTop:5,
    marginBottom:5

  },
  reportButton:{
      backgroundColor:"#3b5998",
      color:"#ffffff"

  },
  subReport: {
    flexDirection: "row",
    color: "#000000",
  },

}));
